member.summary:

Float number between 0 and 1 indicating how much the element should be in viewport before the animation is
               triggered.

@default 0


Specifies if the animation should run only once or everytime the element enters/exits/re-enters the
               viewport.

@default false

The animation effect to use for this attention seeker.
